import React from "react";
import "./App.css";
import Customer from "./Component/customer";

const customers = [
  {
    id: 1,
    img: "https://placeimg.com/64/64/any",
    name: "Jane",
    bday: "560711",
    gender: "Female",
    job: "Marketing",
  },
  {
    id: 2,
    img: "https://placeimg.com/64/64/any",
    name: "Alex",
    bday: "560711",
    gender: "Female",
    job: "Designer",
  },
  {
    id: 3,
    img: "https://placeimg.com/64/64/any",
    name: "Poo",
    bday: "560711",
    gender: "Male",
    job: "Dev",
  },
];

function App() {
  return (
    <div className="background">
      {customers.map((customer) => {
        return (
          <Customer
            key={customer.id}
            img={customer.img}
            name={customer.name}
            bday={customer.bday}
            gender={customer.gender}
            job={customer.job}
          />
        );
      })}
    </div>
  );
}

export default App;
